import Persona from '../models/Persona';
import Telefono from '../models/Telefono';

export async function createPersona(req, res) {
    const { nombre, documento, direccion } = req.body;
    try {
        let newPersona = await Persona.create({
            nombre,
            documento,
            direccion,
        }, {
            fields: ['nombre', 'documento', 'direccion']
        });
        if (newPersona) {
            res.json({
                message: 'Persona creada',
                data: newPersona
            });
        }

    } catch (e) {
        console.log(e);
        res.status(500).json({
            message: 'Algo anda mal',
            data: {}
        });
    }
}

export async function getPersonas(req, res) {
    try {
        const personas = await Persona.findAll({
            include: Telefono,
            attributes: ['personaid', 'nombre', 'documento', 'direccion'],
        });
        res.json( personas );
    }
    catch (e) {
        console.log(e);
    }
}

export async function getOnePersona(req, res) {
    try {
        const { personaid } = req.params;
        const persona = await Persona.findOne({
            include: Telefono,
            where: {
                personaid
            }
        });
        res.json(persona);
    }
    catch (e) {
        console.log(e);
    }
}

export async function deletePersona(req, res) {
    try {
        const { personaid } = req.params;
        const deleteRowCount = await Persona.destroy({
            where: {
                personaid
            }
        })
        res.json({
            message: 'Persona eliminada',
            count: deleteRowCount
        })
    }
    catch (e) {
        console.log(e);
    }
}

export async function updatePersona(req, res){
    const { personaid } = req.params;
    const { nombre, documento, direccion} = req.body;

    const personas = await Persona.findAll({
        include: Telefono,
        attributes: ['personaid', 'nombre', 'documento', 'direccion'],
        where:{
            personaid
        }
    });

    if (personas.length > 0){
        personas.forEach(async persona => {
            await persona.update({
                nombre,
                documento,
                direccion
            });
        });
    }

    return res.json({
        message: 'Persona actualizada exitosamente',
        data: personas
    });
}

