import Sequelize from 'sequelize';
import { sequelize } from '../database/database';
import Telefono from './Telefono';

const Persona = sequelize.define('personas', {
    personaid: {
        type: Sequelize.INTEGER,
        primaryKey: true
    },
    nombre: {
        type: Sequelize.TEXT
    },
    documento: {
        type: Sequelize.TEXT
    },
    direccion: {
        type: Sequelize.TEXT
    }
},
    {
        timestamps: false
    }
);



//many to many
//A.belongsToMany(B, { through: 'C' })

Persona.hasMany(Telefono, { foreignKey: 'personaid', sourceKey: 'personaid' });
Telefono.belongsTo(Persona, { foreignKey: 'personaid', sourceKey: 'personaid' });

export default Persona;

