import Persona from '../models/Persona';
import Profesor from '../models/Profesor';
import Telefono from '../models/Telefono';

export async function createProfesor(req, res) {
    const { titulo, personaid } = req.body;
    const newProfesor = await Profesor.create({
        titulo,
        personaid
    }, {
        fields: ['titulo', 'personaid']
    });
    res.json({
        message: 'Nuevo Profesor creado exitosamente'
    });
}

export async function getProfesores(req, res) {
    const profesores = await Profesor.findAll({
        include: [
            {model: Persona, include: [Telefono] }
        ],
        attributes: ['id', 'titulo', 'personaid'],
        order: [
            ['id', 'DESC']
        ]
    });
    res.json(profesores);
}

export async function getOneProfesor(req, res) {
    const { id } = req.params;
    const profesor = await Profesor.findOne({
        include: [
            {model: Persona, include: [Telefono] }
        ],
        where: {
            id
        }
    });

    res.json(profesor);
}

export async function deleteProfesor(req, res) {
    const { id } = req.params;
    await Profesor.destroy({
        where: {
            id
        }
    });
    res.json({
        message: 'Profesor eliminado exitosamente'
    });
}

export async function updateProfesor(req, res) {
    const { id } = req.params;
    const { titulo, personaid } = req.body;

    await Profesor.findOne({
        include: [
            {model: Persona, include: [Telefono] }
        ],
        attributes: ['id', 'titulo', 'personaid'],
        where: { id }
    });

    const updatedProfesor = await Profesor.update({
        titulo,
        personaid
    }, {
        where: { id }
    });

    res.json({
        message: 'Profesor actualizado',
        updatedProfesor
    });
}

export async function getProfesorByPersona(req, res) {
    const { personaid } = req.params;
    const profesores = await Profesor.findAll({
        include: [
            {model: Persona, include: [Telefono] }
        ],
        attributes: ['id', 'titulo', 'personaid'],
        where: { personaid }
    });

    res.json(profesores);
}

