import Disciplina from '../models/Disciplina';
import Persona from '../models/Persona';
import Profesor from '../models/Profesor';
import Telefono from '../models/Telefono';

export async function createDisciplina(req, res) {
    const { nombre, horario, fechaInicio, fechaFin, importe, porcentajePagaProfesor, profesorid } = req.body;
    const newDisciplina = await Disciplina.create({
        nombre,
        horario,
        fechaInicio,
        fechaFin,
        importe,
        porcentajePagaProfesor,
        profesorid
    }, {
        fields: ['nombre', 'horario', 'fechaInicio', 'fechaFin', 'importe', 'porcentajePagaProfesor', 'profesorid']
    });
    res.json({
        message: 'Se ha creado una nueva Disciplina exitosamente'
    });
}

export async function getDisciplinas(req, res) {
    const disciplinas = await Disciplina.findAll({
        include: [{
            model: Profesor, include: [{
                model: Persona, include: [Telefono]
            }]
        }],
        //attributes: ['disciplinaid', 'nombre', 'horario', 'fechaInicio', 'fechaFin', 'importe', 'porcentajePagaProfesor', 'profesorid'],
        order: [
            ['disciplinaid', 'DESC']
        ]
    });
    res.json(disciplinas);
}

export async function getOneDisciplina(req, res) {
    const { disciplinaid } = req.params;
    const disciplina = await Disciplina.findOne({
        include: [{
            model: Profesor, include: [{
                model: Persona, include: [Telefono]
            }]
        }],
        where: {
            disciplinaid
        }
    });

    res.json(disciplina);
}

export async function deleteDisciplina(req, res) {
    const { disciplinaid } = req.params;
    await Disciplina.destroy({
        where: {
            disciplinaid
        }
    });
    res.json({
        message: 'Se ha eliminado la Disciplina exitosamente'
    });
}

export async function updateDisciplina(req, res) {
    const { disciplinaid } = req.params;
    const { nombre, horario, fechaInicio, fechaFin, importe, porcentajePagaProfesor, profesorid } = req.body;

    await Disciplina.findOne({
        include: [{
            model: Profesor, include: [{
                model: Persona, include: [Telefono]
            }]
        }],
        attributes: ['disciplinaid', 'nombre', 'horario', 'fechaInicio', 'fechaFin', 'importe', 'porcentajePagaProfesor', 'profesorid'],
        where: { disciplinaid }
    });

    const updatedDisciplina = await Disciplina.update({
        nombre,
        horario,
        fechaInicio,
        fechaFin,
        importe,
        porcentajePagaProfesor,
        profesorid
    }, {
        where: { disciplinaid }
    });

    res.json({
        message: 'Disciplina actualizada',
        updatedDisciplina
    });
}

export async function getDisciplinaByProfesor(req, res) {
    const { profesorid } = req.params;
    const disciplinas = await Disciplina.findAll({
        include: [{
            model: Profesor, include: [{
                model: Persona, include: [Telefono]
            }]
        }],
        attributes: ['disciplinaid', 'nombre', 'horario', 'fechaInicio', 'fechaFin', 'importe', 'porcentajePagaProfesor', 'profesorid'],
        where: { profesorid }
    });

    res.json(disciplinas);
}

