import Sequelize from 'sequelize';
import { sequelize } from '../database/database';

import Profesor from './Profesor';

const Disciplina = sequelize.define('disciplinas', {
    disciplinaid: {
        type: Sequelize.INTEGER,
        primaryKey: true
    },
    nombre: {
        type: Sequelize.TEXT
    },
    horario: {
        type: Sequelize.TEXT
    },
    fechaInicio: {
        type: Sequelize.DATE
    },
    fechaFin: {
        type: Sequelize.DATE
    },
    importe: {
        type: Sequelize.DECIMAL
    },
    porcentajePagaProfesor: {
        type: Sequelize.DECIMAL
    },
    profesorid: {
        type: Sequelize.INTEGER
    },
},
    {
        timestamps: false
    }
);

//tiene uno
Disciplina.hasOne(Profesor, { foreignKey: 'id', sourceKey: 'profesorid' });

//muchas tareas le pertenecen a un solo proyecto
Profesor.belongsTo(Disciplina, { foreignKey: 'id', sourceKey: 'id' });

export default Disciplina;

