import Categoria from '../models/Categoria';

export async function createCategoria(req, res) {
    const { nombre, descripcion, importePorMes } = req.body;
    const newCategoria = await Categoria.create({
        nombre,
        descripcion,
        importePorMes
    }, {
        fields: ['nombre', 'descripcion', 'importePorMes']
    });
    res.json({
        message: 'Se ha creado una nueva Categoria exitosamente'
    });
}

export async function getCategorias(req, res) {
    const categorias = await Categoria.findAll({
        attributes: ['categoriaid', 'nombre', 'descripcion', 'importePorMes'],
        order: [
            ['categoriaid', 'DESC']
        ]
    });
    res.json(categorias);
}

export async function getOneCategoria(req, res) {
    const { categoriaid } = req.params;
    const categoria = await Categoria.findOne({
        where: {
            categoriaid
        }
    });

    res.json(categoria);
}

export async function deleteCategoria(req, res) {
    const { categoriaid } = req.params;
    await Categoria.destroy({
        where: {
            categoriaid
        }
    });
    res.json({
        message: 'Se ha eliminado la Categoria exitosamente'
    });
}

export async function updateCategoria(req, res) {
    const { categoriaid } = req.params;
    const { nombre, descripcion, importePorMes } = req.body;

    await Categoria.findOne({
        attributes: ['categoriaid', 'nombre', 'descripcion', 'importePorMes'],
        where: { categoriaid }
    });

    const updatedCategoria = await Categoria.update({
        nombre,
        descripcion,
        importePorMes
    }, {
        where: { categoriaid }
    });

    res.json({
        message: 'Categoria actualizada',
        updatedCategoria
    });
}

