import Persona from '../models/Persona';
import Socio from '../models/Socio';
import Telefono from '../models/Telefono';

export async function createSocio(req, res) {
    const { personaid } = req.body;
    const newSocio = await Socio.create({
        personaid
    }, {
        fields: ['personaid']
    });
    res.json({
        message: 'Se ha creado un nuevo Socio exitosamente'
    });
}

export async function getSocios(req, res) {
    const socios = await Socio.findAll({
        include: [
            { model: Persona, include: [Telefono] }
        ],
        attributes: ['socioid', 'personaid'],
        order: [
            ['socioid', 'DESC']
        ]
    });
    res.json(socios);
}

export async function getOneSocio(req, res) {
    const { socioid } = req.params;
    const socio = await Socio.findOne({
        include: [
            { model: Persona, include: [Telefono] }
        ],
        where: {
            socioid
        }
    });

    res.json(socio);
}

export async function deleteSocio(req, res) {
    const { socioid } = req.params;
    await Socio.destroy({
        where: {
            socioid
        }
    });
    res.json({
        message: 'Se ha eliminado el Socio exitosamente'
    });
}

export async function updateSocio(req, res) {
    const { socioid } = req.params;
    const { personaid } = req.body;

    await Socio.findOne({
        include: [
            { model: Persona, include: [Telefono] }
        ],
        attributes: ['socioid', 'personaid'],
        where: { socioid }
    });

    const updatedSocio = await Socio.update({
        personaid
    }, {
        where: { socioid }
    });

    res.json({
        message: 'Socio actualizado',
        updatedSocio
    });
}

