Socio.hasOne(Persona, { foreignKey: 'personaid', sourceKey: 'personaid' });

//muchas tareas le pertenecen a un solo proyecto
Socio.belongsTo(Persona, { foreignKey: 'personaid', sourceKey: 'personaid' });

export default Socio;

