Jugador.hasOne(Equipo, { foreignKey: 'equipo_id', sourceKey: 'equipo_id' });

//Relaciones "belongsTo/belongsToMany"
Equipo.belongsTo(Jugador, { foreignKey: 'equipo_id' });

export default Jugador;

