import Sequelize from 'sequelize';
import { sequelize } from '../database/database';

import Torneo from './Torneo';

const Etapa = sequelize.define('etapas', {
    etapa_id: {
        type: Sequelize.INTEGER,
        primaryKey: true
    },
    nombre: {
        type: Sequelize.STRING
    },
    anterior_etapa_id: {
        type: Sequelize.INTEGER
    },
    siguiente_etapa_id: {
        type: Sequelize.INTEGER
    },
    torneo_id: {
        type: Sequelize.INTEGER
    },
},
    {
        timestamps: false
    }
);

